import React, { useState, useEffect } from 'react';
import { Card, Grid, Button } from 'semantic-ui-react'


function Crum() {

    const [isEntrega, setEntrega] = useState(false);
    const [isDevolucion, setIsDevolucion] = useState(false);
    const [isActualizar, setIsActualizar] = useState(false);
    const [isAgregar, setIsAgregar] = useState(false);
    const [eleccion, setEleccion] = useState(true);

    return (
        <div>
            <Card fluid>
                <Card.Content>
                    {eleccion && 
                    <Grid  centered>
                            <Button.Group fluid>
                            <Button onClick={e => {setEleccion(!eleccion); setEntrega(!isEntrega)}} >Entrega de productos</Button>
                            <Button onClick={e => { setEleccion(!eleccion); setIsDevolucion(!isDevolucion) }} >Devolución de productos</Button>
                            <Button onClick={e => { setEleccion(!eleccion); setIsActualizar(!isActualizar) }} >Actualizar Stock</Button>
                            <Button onClick={e => { setEleccion(!eleccion); setIsAgregar(!isAgregar) }} >Agregar nuevo producto</Button>
                            </Button.Group>
                    </Grid>
                    }
                    {isEntrega && <div> Entrega de producto <br></br>
                        <Button onClick={e => { setEleccion(!eleccion); setEntrega(!isEntrega);  }} >
                            Back
                            </Button></div>}
                    {isDevolucion && <div> Devolución de producto<br></br>
                        <Button onClick={e => { setEleccion(!eleccion); setIsDevolucion(!isDevolucion); }} >
                        Back
                            </Button> </div>}
                    {isActualizar && <div> Actualizar Stock <br></br>
                        <Button onClick={e => { setEleccion(!eleccion); setIsActualizar(!isActualizar); }} >
                        Back
                            </Button> </div>}
                    {isAgregar && <div> Agregar nuevo producto <br></br>
                        <Button onClick={e => { setEleccion(!eleccion); setIsAgregar(!isAgregar); }} >
                        Back
                            </Button> </div>}
                </Card.Content>
            </Card>

        </div>
    );
}

export default Crum;
